pc.script.createLoadingScreen(function (app) {

    app.firstLoad = true;

    const bg64 = "url('data:image/jpeg;base64,')";




    app.logo = 'data:image/png;base64,';

    const tips = [
        "Tip: You can level up your swords by merging them.",
        "Tip: If you die, you will loose some of your gold and power.",
        "Tip: Each world has its own unique items that are randomly obtained.",
        "Tip: Join our discord to get a chance to win epic giveaways!",
        //"Tip: Play the game from SwordMasters.io to enable chat!",
        "Tip: Epic pets boosts your speed.",
        "Tip: You can share your room with your friends!",
        "Tip: Play the game from SwordMasters.io to get updates first!",
        "Tip: Leveling up becomes harder after level 1000",
        "Tip: You can use Dwarf at the town to upgrade your items",
        "Tip: Enter the trade world to sell your items to other players",
        "Share the game with your friends or imma delete ur acc",
        "Don't share your password with anyone (even admins)",
    ];

    let currentTipIndex = Math.floor(pc.math.random(0, tips.length));
    let tipInterval;

    var showSplash = function () {
        var wrapper = document.createElement('div');
        wrapper.id = 'application-splash-wrapper';
        document.body.appendChild(wrapper);

        var splash = document.createElement('div');
        splash.id = 'application-splash';
        wrapper.appendChild(splash);
        splash.style.display = 'none';

        var spinner = document.createElement('div');
        spinner.id = 'spinner';
        splash.appendChild(spinner);

        var logo = document.createElement('img');
        logo.src = app.logo;
        splash.appendChild(logo);
        logo.onload = function () {
            splash.style.display = 'block';
        };

        var container = document.createElement('div');
        container.id = 'progress-bar-container';
        splash.appendChild(container);

        var bar = document.createElement('div');
        bar.id = 'progress-bar';
        container.appendChild(bar);
        bar.appendChild(spinner);

        var status = document.createElement('div');
        status.id = 'progress-status';
        status.textContent = 'Loading..';
        status.style.textAlign = 'center';
        status.style.fontFamily = "Impact,sans-serif";
        status.style.color = '#ffffff';
        status.style.position = 'relative';
        status.style.bottom = '95%';
        container.appendChild(status);

        var tip = document.createElement('div');
        tip.id = 'progress-tip';
        tip.style.textAlign = 'center';
        //tip.style.marginTop = '20px';
        tip.style.fontFamily = "Impact,sans-serif";
        tip.style.color = '#ffffff';
        splash.appendChild(tip);

        function cycleTips() {
            tip.textContent = tips[currentTipIndex];
            currentTipIndex = (currentTipIndex + 1) % tips.length;
        }

        cycleTips();
        tipInterval = setInterval(cycleTips, 3000);
    };

    var hideSplash = function () {
        clearInterval(tipInterval);
        var splash = document.getElementById('application-splash-wrapper');
        if (splash) splash.parentElement.removeChild(splash);
    };

    var setProgress = function (value) {
        var bar = document.getElementById('progress-bar');
        if (bar) {
            value = Math.min(1, Math.max(0, value));
            bar.style.width = value * 100 + '%';
        }
    };

    var createCss = function () {
        var css = `
            body {
                background-image: ${bg64};
                background-size: 100% 100%;
            }
            #application-splash-wrapper {
                position: absolute;
                top: 0; left: 0;
                height: 100%; width: 100%;
                background-size: cover;
                background-image: ${bg64};
                object-fit: cover;
            }
            #application-splash {
                position: fixed;
                width: 40%;
                top: 50%;
                left: 50%;
                transform: translate(-50%, -50%);
            }
            #application-splash img {
                object-fit: contain;
                transform: translate(50%, 0);
                animation: bounce 1.5s infinite;
                width: 65%;      /* Smaller width */
                max-width: 500px; /* Optional: cap max size */
                height: auto;
                display: block;
                margin: 0 auto;
            }
            #progress-bar-container {
                border-radius: 15px;
                margin: 0px auto 0 auto;
                height: 25px;
                width: 100%;
                background-color: #171717;
                border: 4px solid #171717;
            }
            #progress-bar {
                border-radius: 15px;
                width: 0%;
                height: 100%;
                background-color: #00ff0d;
                box-shadow: inset 0 2px 5px #05c70e;
                background: linear-gradient(180deg, #7cff83, #00ff0d, #00da0b);
                background-size: 300% 100%;
                animation: gradient 2s linear infinite;
            }
            #progress-tip {
                font-size: 28px;
                padding-top: 10px;
                /* White text with black outline (stroke-like effect) */
                text-shadow:
                    -1px -1px 0 #000,
                    1px -1px 0 #000,
                    -1px  1px 0 #000,
                    1px  1px 0 #000;
            }
            @keyframes bounce {
                0%, 20%, 50%, 80%, 100% { transform: translate(0,0); }
                40% { transform: translate(0,-15px); }
                60% { transform: translate(0,-7px); }
            }
            @keyframes gradient {
                0% { background-position: 0% 50%; }
                100% { background-position: 100% 50%; }
            }
            @keyframes spinner {
                0% { transform: translate3d(-50%, -50%, 0) rotate(0deg); }
                100% { transform: translate3d(-50%, -50%, 0) rotate(360deg); }
            }
            #spinner::before {
                animation: 0.6s linear infinite spinner;
                animation-play-state: inherit;
                border: solid 10px #171717;
                border-bottom-color: #00ff44;
                border-radius: 50%;
                content: "";
                height: 20px;
                width: 20px;
                position: absolute;
                top: calc(100% + 25px);
                left: 50%;
                transform: translate3d(-50%, 0, 0);
                will-change: transform;
            }
        `;

        var style = document.createElement('style');
        style.type = 'text/css';
        style.appendChild(document.createTextNode(css));
        document.head.appendChild(style);
    };

    createCss();
    showSplash();

    app.startOld = app.start;
    app.start = function () {
        return app.startOld();
    };

    app.on('preload:start', function () {
        var loaded = 0;
        var total = 0;
        var progressTextStyle = document.getElementById('progress-status').style;

        var onLoad = function () {
            loaded++;
            var status = document.getElementById('progress-status');
            if (!status) return;
            status.textContent = loaded + ' / ' + total + ' loaded';
            if ((loaded / total) > 0.90) status.textContent = 'Joining..';
            if ((loaded / total) > 0.5) progressTextStyle.color = '#000000';
        };

        const assetList = app.assets.list({ preload: true });
        for (var i = 0; i < assetList.length; i++) {
            const asset = assetList[i];
            if (!asset.preload) continue;
            total++;
            if (asset.resource) onLoad();
            else asset.once('load', onLoad);
        }

        document.getElementById('progress-status').style.color = '#ffffff';
        document.getElementById('progress-status').textContent = loaded + ' / ' + total;
    });

    app.on('preload:end', function () {
        app.off('preload:progress');
    });

    app.on('preload:progress', setProgress);
    app.on('start', hideSplash);

});